// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./ERC20.sol";

contract Shop is ERC20 {
    constructor() ERC20("ShopToken", "STK", 1000000) {
    }

    // 상품
    struct Product {
        uint256 id;
        string name;
        uint256 price;
    }

    // // 유저
    // struct User {
    //     address account;
    // }

    // 상품 배열
    Product[] public products;

    // 상품 아이디
    // uint256 productId = 0;

    // 계정 당 구매한 상품
    mapping(address => Product[]) private userProducts;

    // CA가 이더를 받았을때 실행될 함수
    // receive() external payable {
    //     // 10이더를 보내면 5000토큰
    //     uint amount = msg.value * 500;

    //     // require(balanceOf(owner) >= amount);
    //     // // balanceOf(owner) -= amount;
    //     // // balanceOf(msg.sender) += amount;
    //     // _update(owner, msg.sender, amount);

    //     require(balances[owner] >= amount);
    //     balances[owner] -= amount;
    //     balances[msg.sender] += amount;

    //     if (msg.sender == owner) {
    //         mint(owner, amount);
    //     }
    // }

    // 상품 목록 반환
    function getProducts() public view returns (Product[] memory) {
        return products;
    }

    // 특정 사용자가 구매한 상품 목록 반환
    function getUserProducts() public view returns (Product[] memory) {
        return userProducts[msg.sender];
    }

    // 상품 구매
    function buyProduct(uint256 id) public returns (bool) {
        Product memory product;

        // 상품의 가격 찾기
        for (uint256 i=0; i < products.length; i++) {
            if (products[i].id == id) {
                product = products[i];
                break;
            }
        }

        // 돈 없으면 구매 불가
        require(balances[msg.sender] >= product.price);

        // 유저 토큰 감소
        balances[msg.sender] -= product.price;
        // 전체 발행량 감소
        totalSupply -= product.price;

        // _update(msg.sender, owner, product.price);

        // 해당 유저 구매 목록에 추가
        userProducts[msg.sender].push(product);

        return true;
    }

    // 상품 등록
    function registerProduct(string memory _name, uint256 _price) public returns (bool) {
        require(msg.sender == owner);
        uint256 price = _price * (10 ** decimals);
        products.push(Product(block.number, _name, price));
        // products.push(Product(productId, _name, price));
        // productId += 1;

        // return productId-1;
        return true;
    }

}

ERC20.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./IERC20.sol";

contract ERC20 is IERC20 {
    // 토큰의 이름
    string public name;

    // 토큰의 단위 심볼(ETH)
    string public symbol;

    // 토큰의 소수점 자리 (기본 18자리로 구성)
    uint8 public decimals = 18;

    // 토큰의 현재 총 발행량
    uint public override totalSupply;

    address internal owner;

    mapping(address => uint) public balances;
    // {
    //     "0x342432342" : 1000
    // }

    mapping(address => mapping(address => uint)) public override allowance;
    // {
    //     "0x342432342" : {
    //         "0x829890890829" : 500
    //     }
    // }

    // CA 주소로 이더가 전송이 되었을 때 실행시키고 싶은 동작이 있음
    // 익명함수
    // receive 익명함수(특별한 함수)
    // CA에 이더를 받으면 자동으로 실행되는 메서드
    // 이더를 CA에 전송받았을 때 동작을 추가할 수 있음
    receive() external payable {
        // 이더를 CA가 받았을 때 실행되는 동작

        // 배포자가 토큰의 발행량을 관리
        // 다른 이용자들이 토큰을 가지고 싶으면
        // 컨트랙트 배포자가 정한 비율에 따라 토큰을 가져갈 수 있게

        // 소유권을 줄 토큰의 량
        // 받은 이더 비율로
        uint amount = msg.value * 500;

        require(balances[owner] >= amount);
        balances[owner] -= amount;
        balances[msg.sender] += amount;

        // 만약에 토큰 소유권 다 넘겨서 배포자가 들고있는 토큰이 없다.
        // 만약에 배포자가 이더를 보냈으면 더 토큰을 발행할 수 있게
        if (msg.sender == owner) {
            mint(amount);
        }

    }

    // 컨트랙트 생성자
    constructor(string memory _name, string memory _symbol, uint256 _amount) {
        owner = msg.sender;
        name = _name;
        symbol = _symbol;
        mint(_amount * (10 ** uint256(decimals)));
    }

    function mint(uint amount) internal {
        balances[msg.sender] += amount;
        totalSupply += amount;
    }

    function balanceOf(address account) external view override returns (uint) {
        return balances[account];
    }

    function transfer(address to, uint amount) external override returns (bool) {
        balances[msg.sender] -= amount;
        balances[to] += amount;
        return true;
    }

    function approve(address spender, uint amount) external override returns (bool) {
        allowance[msg.sender][spender] = amount;
        return true;
    }

    function transferFrom(address sender, address to, uint amount) external override returns (bool) {
        require(allowance[sender][msg.sender] >= amount);
        // sender == A
        // msg.sender == B
        // to == C
        // {
        //     A : {
        //         B : 100
        //     }
        // }

        // {
        //     A : 1000
        // }



        allowance[sender][msg.sender] -= amount;
        balances[sender] -= amount;
        balances[to] += amount;

        // {
        //     A : {
        //         B : 50
        //     }
        // }

        // {
        //     A : 950,
        //     C : 50
        // }

        return true;
    }

    function burn(uint amount) external {
        balances[msg.sender] -= amount;
        totalSupply -= amount;

    }

}

IERC20.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

interface IERC20 {
    function totalSupply() external view returns(uint);

    function balanceOf(address account) external view returns (uint);

    function transfer(address to, uint amount) external returns (bool);

    function allowance(address owner, address spender) external returns (uint);

    function approve(address spender, uint amount) external returns (bool);

    function transferFrom(address spender, address to, uint amount) external returns (bool);

    
}

